body:
Background:
Spartacadabra protocols are about to launch in a day.

This proposal is to allow community to decide what the emission rates of the farming pools will be. The team has done the analysis and wanted to share our proposal. We want the values to be a reasonable range to ensure the protocols are healthy in the long run.

This proposal to vote for the emission rate for Lambda-2Pool on ftm.curve.fi. This is based on assumption of $5M TVL (total value locked). APR can vary with TVL.

Proposal:
Vote for the emission rate for Lambda-2Pool pool on Curve. Please keep in mind this is a stablecoin pool.
﻿
Option 1. 9,681,010 Charm daily. 20% APR;
Option 2. 8,712,909 Charm daily. 18% APR;
Option 3. 7,744,808 Charm daily. 16% APR;
